function OrderConfirm({ orderDetails, cartItems }) {
  console.log("order details in confirm: ", orderDetails);
  return (
    <>
      <h1 className="text-4xl text-center my-8">Order Confirmation Page</h1>
      <p>Name: Daniel Ndanema</p>
      <p>Email: dndanema@yahoo.com</p>
      <p>
        Address: Limkokwing University, Inovasi 1-1, Jalan Teknokrat 1/1, Off
        Jalan Apec, Cyberjaya, Selangor, Malaysia
      </p>
      <p>Payment Option: Credit</p>
      <ul>
        {orderDetails.items.map((item) => (
          <OrderConfirmItem key={item.id} />
        ))}
      </ul>
    </>
  );
}

function OrderConfirmItem() {
  return <li></li>;
}

export default OrderConfirm;
